import aos from 'aos';
import 'aos/dist/aos.css';


const WhyChooseUs2 = (props) => {

    useEffect(() =>{
        aos.init({duration: 1900})
    }, [])

    return (
        <div className={styles.Main}>
            <div>
                <img src={img} />
            </div>
            <div className={styles.Para}>
                <h3>{props.title}</h3>
                <p>{props.para}</p>
            </div>
        </div>
    )
}

export default WhyChooseUs2;
